import React, { Component } from 'react';

class CallInfoForm extends Component{
constructor(props){
    super(props);
    this.state = {
        callerName: "",
        callerGroup: "",
        callerNumber: "",
        EROverflow: "",
        CustomerName:"",
        SiteLocation: "",
        OtherPeopleInvolved: "",
        OutageLevel:"",
        SFDCAv: "",
        AppSFDCNum: "",
        SDFCComp: ""
    }
   this.handleChange = this.handleChange.bind(this);
   this.handleSubmit = this.handleSubmit.bind(this);

}
handleChange(event) {
    this.setState({[event.target.name]: event.target.value});
    
  }

  handleSubmit(event) {
    return this;
  }
  render() {
    return (
      <div>
       <h1> Call Info </h1>
       <form onSubmit = {this.handleSubmit}> 


       </form>

      </div>
    );
  }
}


export default CallInfoForm;
